import Layout from '../components/MyLayout';
import Link from 'next/link';
import axios from 'axios';

const Index = (props:any) => (
  <Layout>
    <h1>Posts</h1>
    { console.log(props.posts[0].data.title) }
    <ul>
      {props.posts.map((post:any) => (
        <li key={post.data.id}>
          <Link href="/p/[id]" as={`/p/${post.data.id}`}>
            <a>{post.data.title}</a>
          </Link>
        </li>
      ))}
    </ul> 
  </Layout>
);

Index.getInitialProps = async function() {
  const res = axios.get('https://simple-blog-api.crew.red/posts/');
  // const data = await res.json();

  console.log(`Show data fetched. Count: ${(await res).status}`);

  return {
    posts: (await res).data
  };
};

export default Index;
